// 给定一个字符串 s 和一些 长度相同 的单词 words 。找出 s 中恰好可以由 words 中所有单词串联形成的子串的起始位置。
// 注意子串要与 words 中的单词完全匹配，中间不能有其他字符 ，但不需要考虑 words 中单词串联的顺序。
// 来源：力扣（LeetCode）
// 链接：https://leetcode-cn.com/problems/substring-with-concatenation-of-all-words
// 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。

/**
 * @param {string} s
 * @param {string[]} words
 * @return {number[]}
 * 循环遍历 words 和 s
 *  如果s中某个字符与words某个单词首字母相同
 *  则通过固定的单词长度截取单词
 *  如果截取的单词存在于words中，截取从这个字母开始到words个每个单词长度个数的字符串
 *  将截取的字符串按照固定长度分割
 *  对比得到的切割数组与words用同样的方法排序后join成字符串是否相等
 *
 */
let findSubstring = (s, words) => {
    let wordLength = words[0].length;
    let wordsCount = words.length;
    let result = [];
    // 遍历的words可能存在相同单词，在同一个地方肯会遍历多次
    [...new Set(words)].forEach((word) => {
        s.split("").forEach((item, index) => {
            if(!result.includes(index)){
                if (word[0] == item) {
                    let beforeWord, visWords;
                    beforeWord = s.substr(index, wordLength);
                    if (words.includes(beforeWord)) {
                        // 获取预期要得到的字符串
                        visWords = s.substr(index, wordLength * wordsCount);

                        if (visRepeat(words, visWords)) {
                            result.push(index);
                        }
                    }
                }
            }
        });
    });
    return result.sort((a, b) => a - b);
};

let visRepeat = (words, str) => {
    let creatWords = "";
    let wordLength = words[0].length;
    let visWords = [].concat(words);
    let splList = [];

    // 将字符串安装指定个数分割
    str.split("").forEach((item, index) => {
        // 判断索引是否为单词长度的整数倍数
        let val = index / wordLength;

        if (Math.floor(val) == val && val != 0) {
            //如果是整数倍
            // visWords.remove(creatWords);
            splList.push(creatWords)
            creatWords = "";
        }
        creatWords += item;

        //最后一个字母的时候
        if (index == str.length - 1) {
            // visWords.remove(creatWords);
            splList.push(creatWords)
            creatWords = "";
        }
    });


    if(splList.sort().join("") == visWords.sort().join("")){
        return true;
    }
    // if (visWords.length == 0) {
    //     return false;
    // }
};

Array.prototype.remove = function (val) {
    var index = this.indexOf(val);
    if (index > -1) {
        this.splice(index, 1);
    }
};

